      SELECT DISTINCT + col1 / 14 * - col0 - + + col2 / - col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q12328.out
    data: |
      -138
      -300
      -320
